import React from "react";
import {  MDBContainer } from "mdbreact";
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
const FooterPage = () => {
  return (
    <div>
    <Container>
  <Row>
    <Col>
    <div className="ico">
    <ion-icon style={{'color':'blue'}} name="logo-facebook"></ion-icon> 
    </div>
    <div className="ico"></div>
 <ion-icon style={{'color':'white'}} name="logo-twitter"></ion-icon> 
 <div className="ico"></div>
 <ion-icon style={{'color':'white'}} name="logo-linkedin"></ion-icon> 
 <div className="ico"> <ion-icon style={{'color':'white'}} name="logo-instagram"></ion-icon> 
</div>
</Col>
    <Col>  
    <div className="footer-copyright text-center py-3">
        <MDBContainer style={{'color':'black'}} fluid>
          &copy; {new Date().getFullYear()} Copyright: <a href="https://www.mdbootstrap.com" style={{'color':'black'}}> Influencer.fr </a>
        </MDBContainer>
           
    </div>
    </Col>
  
         
        
        
      
    </Row>
    </Container>
  
</div>
      
      
  );
}

export default FooterPage;
